We have to create some files holding the AdmissionReview objects that will be evaluated by the policy. Let's create a file named pod-req-no-specific-apparmor-profile.json with the following contents: { "kind": { "kind": "Pod", "version": "v1" }, "object": { "metadata": { "name": "no-apparmor" }, "spec": { "containers": [ { "image": "nginx", "name": "nginx" } ] } }, "operation": "CREATE", "requestKind": {"version": "v1", "kind": "Pod"}, "userInfo": { "username": "alice", "uid": "alice-uid", "groups": ["system:authenticated"] }
} This request tries to create a Pod that doesn't specify any AppArmor profile to be used, that's because it doesn't have an annotation with the container.apparmor.security.beta.kubernetes.io/<name of the container> key. Let's create a file named pod-req-apparmor-unconfined.json with the following contents: { "kind": { "kind": "Pod", "version": "v1" }, "object": { "metadata": { "name": "privileged-pod", "annotations": { "container.apparmor.security.beta.kubernetes.io/nginx": "unconfined" } }, "spec": { "containers": [ { "image": "nginx", "name": "nginx" } ] } }, "operation": "CREATE", "requestKind": {"version": "v1", "kind": "Pod"}, "userInfo": { "username": "alice", "uid": "alice-uid", "groups": ["system:authenticated"] }
} This request tries to create a Pod with a container called nginx that is going to be run with the unconfined AppArmor profile. This is considered a bad security practice. Finally, let's create a file named pod-req-apparmor-custom.json with the following contents: { "kind": { "kind": "Pod", "version": "v1" }, "object": { "metadata": { "name": "privileged-pod", "annotations": { "container.apparmor.security.beta.kubernetes.io/nginx": "localhost/nginx-custom" } }, "spec": { "containers": [ { "image": "nginx", "name": "nginx" } ] } }, "operation": "CREATE", "requestKind": {"version": "v1", "kind": "Pod"}, "userInfo": { "username": "alice", "uid": "alice-uid", "groups": ["system:authenticated"] }
} This request tries to create a Pod with a container called nginx that is going to be run with the profile provided by the administrators of the Kubernetes cluster. This profile is called nginx-custom. Note well: these are stripped down AdmissionReview objects, we left only the fields that are relevant to our policy.

