It's time to write the actual validation code. This is defined inside of the src/lib.rs file. Inside of this file you will find a function called validate. The scaffolded function is already doing something: fn validate(payload: &[u8]) -> CallResult { // NOTE 1 let validation_request: ValidationRequest<Settings> = ValidationRequest::new(payload)?; // NOTE 2 match serde_json::from_value::<apicore::Pod>(validation_request.request.object) { Ok(pod) => { // NOTE 3 if pod.metadata.name == Some("invalid-pod-name".to_string()) { kubewarden::reject_request( Some(format!("pod name {:?} is not accepted", pod.metadata.name)), None, ) } else { kubewarden::accept_request() } } Err(_) => { // NOTE 4 // We were forwarded a request we cannot unmarshal or // understand, just accept it kubewarden::accept_request() } }
} This is a walk-through the code described above: Parse the incoming payload into a ValidationRequest<Setting> object. This automatically populates the Settings instance inside of ValidationRequest with the params provided by the user. Convert the Kubernetes raw JSON object embedded into the request into an instance of the Pod struct The request contains a Pod object, the code approves only the requests that do not have metadata.name equal to the hard-coded value invalid-pod-name The request doesn't contain a Pod object, hence the policy accepts the request As you can see the code is already doing a validation that resembles the one we want to implement. We just have to get rid of the hard-coded value and use the values provided by the user via the policy settings. This can be done with the following code: fn validate(payload: &[u8]) -> CallResult { let validation_request: ValidationRequest<Settings> = ValidationRequest::new(payload)?; match serde_json::from_value::<apicore::Pod>(validation_request.request.object) { Ok(pod) => { let pod_name = pod.metadata.name.unwrap_or_default(); if validation_request .settings .invalid_names .contains(&pod_name) { kubewarden::reject_request( Some(format!("pod name {:?} is not accepted", pod_name)), None, ) } else { kubewarden::accept_request() } } Err(_) => { // We were forwarded a request we cannot unmarshal or // understand, just accept it kubewarden::accept_request() } }
} Finally, we will create some unit tests to ensure the validation code works as expected. The lib.rs file has already some tests defined at the bottom of the file, as you can see Kubewarden's Rust SDK provides some test helpers too. Moreover, the scaffolded project already ships with some default test fixtures inside of the test_data directory. We are going to take advantage of these recorded admission requests to write our unit tests. Change the contents of the test section inside of src/lib.rs to look like that: #[cfg(test)]
mod tests { use super::*; use kubewarden_policy_sdk::test::Testcase; use std::collections::HashSet; #[test] fn accept_pod_with_valid_name() -> Result<(), ()> { let mut invalid_names = HashSet::new(); invalid_names.insert(String::from("bad_name1")); let settings = Settings { invalid_names }; let request_file = "test_data/pod_creation.json"; let tc = Testcase { name: String::from("Pod creation with valid name"), fixture_file: String::from(request_file), expected_validation_result: true, settings, }; let res = tc.eval(validate).unwrap(); assert!( res.mutated_object.is_none(), "Something mutated with test case: {}", tc.name, ); Ok(()) } #[test] fn reject_pod_with_invalid_name() -> Result<(), ()> { let mut invalid_names = HashSet::new(); invalid_names.insert(String::from("nginx")); let settings = Settings { invalid_names }; let request_file = "test_data/pod_creation.json"; let tc = Testcase { name: String::from("Pod creation with invalid name"), fixture_file: String::from(request_file), expected_validation_result: false, settings, }; let res = tc.eval(validate).unwrap(); assert!( res.mutated_object.is_none(), "Something mutated with test case: {}", tc.name, ); Ok(()) } #[test] fn accept_request_with_non_pod_resource() -> Result<(), ()> { let mut invalid_names = HashSet::new(); invalid_names.insert(String::from("prod")); let settings = Settings { invalid_names }; let request_file = "test_data/ingress_creation.json"; let tc = Testcase { name: String::from("Ingress creation"), fixture_file: String::from(request_file), expected_validation_result: true, settings, }; let res = tc.eval(validate).unwrap(); assert!( res.mutated_object.is_none(), "Something mutated with test case: {}", tc.name, ); Ok(()) }
} We now have three unit tests defined inside of this file: accept_pod_with_valid_name: ensures a Pod with a valid name is accepted reject_pod_with_invalid_name: ensures a Pod with an invalid name is rejected accept_request_with_non_pod_resource: ensure the policy accepts request that do not have a Pod as object We can run the unit tests again: $ cargo test Compiling demo v0.1.0 (/home/flavio/hacking/kubernetes/kubewarden/demo) Finished test [unoptimized + debuginfo] target(s) in 3.45s Running target/debug/deps/demo-24670dd6a538fd72 running 5 tests
